*Sim! O afrontoso mandou prender o*➡️ CAPITÃO ⬅️ *Assumção...🤡  Para os que ficam loucos com tudo isso sem entender o motivo de Bolsonaro não agir, explico:*  *Aparentemente o Presidente só fará algo quando o recesso do Congresso começar (inicia dia 20/12). Isso dá uma brecha na lei para que ele peça intervenção sem a necessidade da aprovação da casa, como bem explicou o Professor Mauro Rosa.   Se não for dessa forma, pode acontecer com ele o mesmo que aconteceu no Peru, e é por isso que a esquerda está louca armando arapucas e tomando decisões descabidas, afim de pressionar o Bolsonaro*.*Entendam isso e divulguem, para que as pessoas parem de pressiona-lo também, pois estão fazendo o jogo da esquerda* *Bolsonaro está muito bem assessorado, está por dentro de tudo isso e sabe o que faz.* *QUANTO A NÓS, ESTAMOS QUASE LÁ: NÃO PARAR, NÃO PRECIPITAR, NÃO RETROCEDER!*

